const Home = () => {
    useEffect(() => {
        const fetchSlots = async () => {
            const response = await fetch('localhost:4000/api/slots')
        }
    }, []);
    return (
        <div className="Home">
            <h2>Home</h2>
        </div>
    )
}

export default Home;
